const socialMedia =  [
    {
        name:'Facebook',
        link: 'www.fb.com'
    }
    ,{
        name:'Instagram',
        link: 'www.instagram.com'
    }
    ,{
        name:'Booksy',
        link: 'www.booksy.com'
    }
]

const socialMediaButtons = () =>{
    
    //open a new tab with its respective link
    const handleClick = (link)=>{
        window.open(
            link, '__blank'
        )
    }
    //generate social media buttons
    const generateButtons = () =>
        socialMedia.map((item) =>{
            return(
                <button className = 'button__Facebook' key = {item.link} onClick = {()=>{handleClick(item.link)}} >{item.name}</button>
            )
        })
    
    

    return(
        <div>
            {generateButtons()}
            <button className = 'button__Instagram'/>
            <button className = 'button__Booksy'/>
        </div>
    )
}

export default socialMediaButtons;
